CREATE TABLE PenerimaanDana(
   ID int NOT NULL AUTO_INCREMENT PRIMARY KEY
  ,Nama_Sekolah            VARCHAR(50) NOT NULL 
  ,NPSN                    INTEGER  NOT NULL
  ,Status                  VARCHAR(6) NOT NULL
  ,Penerimaan_Dana_TW_1_Rp INTEGER  NOT NULL
  ,Penerimaan_Dana_TW_2_Rp INTEGER  NOT NULL
  ,Penerimaan_Dana_TW_3_Rp INTEGER  NOT NULL
  ,Penerimaan_Dana_TW_4_Rp INTEGER  NOT NULL
);
